import React from "react";
import ResumeItem from "../ResumeItems";
import * as C from "./style";
import {
  FaRegArrowAltCircleUp,
  FaRegArrowAltCircleDown,
  FaDollarSign,
} from "react-icons/fa";

const Resume = () => {
  return (
    <C.Container>
      <ResumeItem
        title="Entradas"
        Icon={FaRegArrowAltCircleUp}
        value="1000"
      />
      <ResumeItem
        title="Saídas"
        Icon={FaRegArrowAltCircleDown}
        value="1000"
      />
      <ResumeItem 
        title="Total" 
        Icon={FaDollarSign} 
        // value={total} 
        />
    </C.Container>
  );
};

export default Resume;
